function searchText(str) {
    var div = document.createElement('div');
    div.innerHTML = document.body.innerHTML;
    var elements = div.getElementsByTagName('*');
    for(var i = elements.length; 0 > i--;) {
        elements[i].style.display = 'inline';
    }
    return (div.innerText || div.textContent).indexOf(str) > -1;
}

function classifyCurrentPage() {
    switch (window.location.href) {
        case "https://grants.myrosmol.ru/":
            return 0
        case "https://grants.myrosmol.ru/articles":
            return 1
        case "https://grants.myrosmol.ru/events":
            return 2
        case "https://grants.myrosmol.ru/projects":
            return 3
        case "https://grants.myrosmol.ru/projects-archive":
            return 4
        case "https://grants.myrosmol.ru/participants":
            return 5
        case "https://grants.myrosmol.ru/agreements":
            return 6
        case "https://grants.myrosmol.ru/reports":
            return 7
        default:
            if (window.location.href.includes("grants.myrosmol.ru/projects")) {
                if (searchText("Название проекта должно содержать в себе как описательную часть,")) {
                    return 8
                }
                else if (searchText("В разделе необходимо дать понятное изложение всего проекта")) {
                    return 19
                }
                else if (searchText("Команда проекта – лица в возрасте от 14 до 35 лет.")) {
                    return "Команда"
                }
                else if (searchText("В данном разделе отображается информация о результатах социального")) {
                    return "Результаты"
                }
                else if (searchText("Рекомендуется определять для проекта не более 5 задач. В рамках")) {
                    return "Календарный план"
                }
                else if (searchText("В данном разделе необходимо сформировать развернутый контент-план")) {
                    return "Медиа"
                }
                else if (searchText("Указываются ресурсы, которые есть у команды проекта в наличии")) {
                    return "Софинансирование"
                }
                else if (searchText("В данном разделе размещаются любые важные для формирования у эксперта")) {
                    return "Доп. файлы"
                }
                else if (searchText("В запрашиваемую сумму проекта нужно включать только те необходимые ресурсы")) {
                    return "Расходы"
                }
                else {
                    return "Unknown"
                }
            }
            else {
                return "Unknown"
            }
    }
}

